    import Vue from 'vue'
import Manage from "@/views/Manage";
import User from "@/views/User";
import Login from "@/views/Login";
import Register from "@/views/Register";
import File from "@/views/File";
import VueRouter from 'vue-router'
import AuditMeeting from "@/views/AuditMeeting";
import Meeting from "@/views/Meeting";
import AddMeeting from "@/components/AddMeeting";
import UserInfo from "@/components/UserInfo";
import MeetingList from "@/views/MeetingList";
import ApplyMeeting from "@/views/ApplyMeeting";
import RemindMessage from "@/views/RemindMessage";
import Sign from "@/views/Sign";
import join from "@/views/join";
import tabCreateMeeting from "@/views/tabCreateMeeting"
import ScheduledMeeting from "@/views/ScheduledMeeting";
import Im from "@/views/Im";



Vue.use(VueRouter)
const RouterPush = VueRouter.prototype.push
VueRouter.prototype.push = function push (to) {
    return RouterPush.call(this, to).catch(err => err)
}
const RouterReplace = VueRouter.prototype.replace
VueRouter.prototype.replace = function replace (to) {
    return RouterReplace.call(this, to).catch(err => err)
}
const routes = [

    {
        path: '/',
        name: 'Login',
        component: Login,
    },

    {
        path: '/Register',
        name: 'Register',
        component: Register,
    },
    {
        path: '/AddMeeting',
        name:'/AddMeeting',
        component: AddMeeting,
    },
    {
        path: '/userinfo',
        component: UserInfo,
        children: [
            // {
            //     path: '/',
            //     component: MyInfo,
            // },
            {
                path: 'Im',
                component: Im
            },
            {
                path: "meetinglist",
                component: MeetingList,
            },
            {
                path: "applymeeting",
                component: ApplyMeeting,
            },
            {
                path: "remindmessage",
                component: RemindMessage,
            },
            {
                path: "sign",
                component: Sign
            },
            {
                path: "ScheduledMeeting",
                component: ScheduledMeeting,
            },

            {   
                name: 'join',
                path: "join",
                component: join 
            },{

                name:'tabCreateMeeting',
                path: 'tabCreateMeeting',
                component: tabCreateMeeting
            },{
                name:'theMeeting',
                path: 'theMeeting',
                component:  () => import('@/views/meeting/index'),
            }
        ],
    },



    {
        path: '/Admin',
        name: 'Manage',
        component: Manage,
        children: [
            {
            path: 'user',
            name: 'User',
            component: User
        },
         {
            path: 'File',
            name: 'File',
            component: File,
        },
            {
             path: 'Meeting',
             name:'Meeting',
             component: Meeting,
            },
            {
                path: 'AuditMeeting',
                name:'AuditMeeting',
                component: AuditMeeting,
            },
        ]
    },

]


const router = new VueRouter({
    mode: 'history',
    base: process.env.BASE_URL,
    routes
})

export default router
